import React from "react";

const images = [
  { src: "/images/nail1.jpg", alt: "Nail design 1" },
  { src: "/images/nail2.jpg", alt: "Nail design 2" },
  { src: "/images/nail3.jpg", alt: "Nail design 3" },
  { src: "/images/nail4.jpg", alt: "Nail design 4" },
  { src: "/images/nail5.jpg", alt: "Nail design 5" },
  { src: "/images/nail6.jpg", alt: "Nail design 6" },
];

export default function Gallery() {
  return (
    <section id="gallery" className="py-16 bg-white">
      <h2 className="text-2xl font-bold text-center mb-8">Our Nail Gallery</h2>
      <p className="text-center text-gray-600 mb-10">
        Discover our collection of beautiful nail designs and get inspired for
        your next appointment.
      </p>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-5xl mx-auto">
        {images.map((img, index) => (
          <div
            key={index}
            className="w-full h-64 bg-gray-100 rounded-lg shadow overflow-hidden"
          >
            <img
              src={img.src}
              alt={img.alt}
              className="w-full h-full object-cover"
            />
          </div>
        ))}
      </div>
    </section>
  );
}
